INSERT INTO `controlmsg` (`Id`, `infoType`, `text`, `url`, `version`, `validflag`) VALUES
(1, 'newapk', '您好，本软件有升级版本1.08(胆拖及复式组号,初级推荐红球及篮球等等)，请点击链接下载更新或近期去安卓市场下载更新版。', 'http://pan.baidu.com/share/link?shareid=2788842171&uk=2333494015', '1.08', 1);
INSERT INTO `experienceshare` (`Id`, `title`, `htmlText`) VALUES
(1, '正确选择购买彩票的方法', '<br>\r\n购买福彩双色球33选6的玩法有多种多样，在众多的玩法中，用何种方法买彩才能中奖呢？\r\n<br><br>\r\n在所有的玩法中，开销与中奖回报是一对矛盾，在作出选择前，请确保遵守以下两条\r\n基本原则：<br><br>\r\n1.选择一个适合自己的玩法，并深入了解；<br>\r\n2.长期坚持你的玩法，并持续下去。<br>\r\n<br>\r\n<b>一、复式购买法</b><br>\r\n复式买法是命中率最高的玩法，它是指一次购买看好的全部多个红球和篮球，它是开销最大\r\n的，需要的财力也更多，针对个人往往不是很实惠和现实；常见的复式买法有7+1（购买7个红\r\n球，1个篮球），8+1（购买8个红球，1个篮球），10+1（购买10个红球，1个篮球）等。<br>\r\n<br>\r\n<b>二、胆拖式购买法</b><br>\r\n胆拖式购买法是复式买法的一种演变，比如看好某1个，2个或3个红球必出，定为胆码，\r\n然后选择其他认为可能出现的多个红球作为拖码。此法相比全复式买法在操作同样个数\r\n的号码时，更经济实惠，然而定胆相对较难，一端胆码选择错误，则全盘皆覆。\r\n<br><br>\r\n<b>三、条件过滤法</b><br>\r\n技术派玩法有如常见的条件过滤玩法，即总结中奖号码并找出各种常见的条件（如AC值，\r\n偶数，大数，尾码，相邻码，分区条件，行列条件，杀号条件等等各类条件），猜测这些\r\n条件的值，然后利用电脑软件过滤组合出符合这些条件的单注号码来购买。此方法的前提\r\n是要猜对这些条件的取值，然而往往猜对条件的出值也相对较难，尤其是在条件较多的情\r\n况下，猜对这些条件的取值比直接猜测6个红球更难！双色球33个红球选对6个红球的概率\r\n是1107568(一百一十万七千五百六十八)分之1，然而如果条件过多，往往选对条件的概率比直接选择6个红球的概率\r\n更低！这种方法的前提是要总结并提炼出较好的条件组合，而且依赖计算机软件提供过滤\r\n功能，常见的较好的条件过滤法有：行列条件过滤法、九层遗漏条件过滤法、尾数条件过\r\n滤法等。\r\n<br>\r\n<br>四、旋转矩阵法</b><br>\r\n旋转矩阵法也叫聪明组合法，是美国彩票大师盖尔.霍华德提出来的，它的理论基础是\r\n现代组合数学中的概率覆盖理论，盖尔.霍华德在《聪明组合》一书中给出了早期的多组聪\r\n明组合模式。<br><br>\r\n以双色球选6码为例，聪明组合模式常常以“m码中6保5”，“m码中6保4”，”m码中5保4“等模\r\n式给出，其含义是：如果选择的m个(m>6)红球包含了当期中奖号码的6个红球，那么按“m码中\r\n6保5”模式组合出来的号码组将保证有至少1注号码击中当期5个中奖号码的奖项；依次类\r\n推，如果选择的m个红球包含了当期中奖号码的5个红球，那么按“m码中5保4”模式组合出来\r\n的号码组将保证有至少1注号码击中当期4个中奖号码的奖项。这里的按该模式组合出来的\r\n号码组数将比用复式 或 胆拖式组合出来的号码注数大大减少，例如某期你看好了某10个红球\r\n号码（先不考虑篮球），而这10个红球号码刚好选中了当期开奖的6个红球数字，如果采用复\r\n式购买此10个红球，则复式组合有210注号码共需要420元，而如果运用“10码中6保5”模式，只\r\n需要16注号码共32元，即可保证此16注号码击中一个5个红球的奖项.（10码中6保5模式的含义\r\n是：如果选择的10个红球包含当期的6红，那么利用该旋转矩阵模式组合出的16注号码保证中\r\n至少一个5红的奖项，而且这16注号码有很大的概率可以击中6红的奖项）。\r\n<br><br>\r\n旋转矩阵法 或 聪明组合法可以实现在操作同样个数的红球数字情况下，采用给定的组合模式，\r\n达到以最少注数和最平衡的方式实现中奖。此法相比全复试购买，大大节省资金以达到中奖目\r\n的。相比早期盖尔.霍华德提出的第一代旋转矩阵，国外数学界有很多研究平衡旋转矩阵的人，\r\n最新的研究成果利用高性能计算机计算出的平衡组合已经比早期盖尔.霍华德给出的组合更加\r\n平衡，需要的组合数更少。目前全球最新的“聪明组合”研究成果是由Iliya Bluskow博士在2010年\r\n给出。注：旋转矩阵或聪明组合方法的前提是如何选择多个红球来保证中奖，常见的方法即是\r\n根据本软件提供的“红球遗漏走势图“来选择多个红球，本软件将陆续更新此中奖经验栏目并提供\r\n多种选红球的方法来帮助你中奖。<br>\r\n<br><br>\r\n因此，好的中奖方法应该是科学的、有效的，在保证中奖回收成本的前提下，以一定的概率冲\r\n击大奖，而不是盲无目的地买彩。选择并深入了解一种方法，然后坚持不懈，成功就在眼前！\r\n<br>\r\n'),
(2, '旋转组号模式的使用和说明', '<br>用旋转组号法也即聪明组合法购买彩票，需要根据所选红球的个数不同，选择对应的旋转组号模式进行组号。下面是常见的组号模式的说明：<br><br>组号模式都以《n个红码-中x保y-m注》的形式表示，那么这样一个模式是什么含义呢？<br><br>例如：以《8个红码-中6保5-4注》模式为例说明，这里的8个红码表示你选择了8个红球，也即，你根据遗漏走势图的走势情况，选出了8个看好的红球（如何根据遗漏走势图选择红球，我会在以后的经验分享中陆续说明）；<br><br>这里的中6保5的含义是：如果你选择的8个红球里面包含了当期开奖的6个红球号码，那么根据此旋转组号模式组号出来的号码组（共4注-也即后面-4注的含义）里面，会保证你中至少一注5红的奖项；也即如果你选择的8个红球包含了当期开奖号码的全部6个红球，如果你购买了根据此模式组号出来的全部4注号码，那么会保证你中一个5红的奖项，只需购买4注号码。<br><br>当然，如果你以复式的形式购买你选择的全部8个红球号码（32注号码），那么你就会中一个6红的奖项，当然你付出的也更多（你需要购买32注）； 而采用旋转组号，你只需要购买4注。这就是旋转组号也即聪明组合模式的含义和技巧。<br><br>所以，采用旋转矩阵也即聪明组号买彩票很简单，只需三步：<br><br>一、在遗漏图中选择看好的红球<br>二、根据所选择的红球个数选择对应的模式<br>三、组号即可。'),
(3, '如何根据遗漏走势图选择红球', '本文讲解说明如何利用本软件中的遗漏走势图选择红球。<br><br>一、选重码<br><br>二、选邻码<br><br>三、选热码<br><br>本文将陆续更新，请定期查看。');
